import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import './style.scss';

const ContactPage = () => {
    const initialValues = {
        name: '',
        phone: '',
        email: '',
        subject: '',
        message: ''
    };

    const validationSchema = Yup.object({
        name: Yup.string().required('Nome é obrigatório'),
        phone: Yup.string().required('Telefone é obrigatório'),
        email: Yup.string().email('Email inválido').required('Email é obrigatório'),
        subject: Yup.string().required('Assunto é obrigatório'),
        message: Yup.string().required('Mensagem é obrigatória')
    });

    const onSubmit = (values, { resetForm }) => {
        console.log('Form data', values);
        // Aqui você pode enviar os dados do formulário para o servidor ou processá-los conforme necessário
        resetForm();
    };

    return (
        <section id="contactPage">
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <h1 className="bold text-center">Contato</h1>
                        <p className='text-center'>Entre em contato conosco através do formulário abaixo</p>
                        <br />
                        <Formik
                            initialValues={initialValues}
                            validationSchema={validationSchema}
                            onSubmit={onSubmit}
                        >
                            {formik => (
                                <Form>
                                    <div className="form-group col-md-6">
                                        <label htmlFor="name">Nome</label>
                                        <Field type="text" id="name" name="name" className="form-control" placeholder='Digite o nome' />
                                        <ErrorMessage name="name" component="div" className="text-danger" />
                                    </div>

                                    <div className="form-group col-md-6">
                                        <label htmlFor="phone">Telefone</label>
                                        <Field type="text" id="phone" name="phone" className="form-control" placeholder='Digite o telefone' />
                                        <ErrorMessage name="phone" component="div" className="text-danger" />
                                    </div>

                                    <div className="form-group col-md-12">
                                        <label htmlFor="email">Email</label>
                                        <Field type="email" id="email" name="email" className="form-control" placeholder='Digite o e-mail'/>
                                        <ErrorMessage name="email" component="div" className="text-danger" />
                                    </div>

                                    <div className="form-group col-md-12">
                                        <label htmlFor="subject">Assunto</label>
                                        <Field type="text" id="subject" name="subject" className="form-control" placeholder='Digite o assunto' />
                                        <ErrorMessage name="subject" component="div" className="text-danger" />
                                    </div>

                                    <div className="form-group col-md-12">
                                        <label htmlFor="message">Mensagem</label>
                                        <Field as="textarea" id="message" name="message" className="form-control" placeholder='Digite a mensagem'/>
                                        <ErrorMessage name="message" component="div" className="text-danger" />
                                    </div>

                                    <div className="text-center col-md-12">
                                        <button type="submit" className="btn btn-primary">Enviar</button>
                                    </div>
                                </Form>
                            )}
                        </Formik>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default ContactPage;
